    <Grid container justify="space-between" spacing={0}>
      <Grid
        item
        {...{ xl: 12, lg: 12, md: 12, xs: 12, sm: 12 }}
        container
        spacing={6}
      >
        <Grid item {...{ xl: 12, lg: 12, md: 12, xs: 12, sm: 12 }}>
          ali
        </Grid>
      </Grid>
    </Grid>
  );
};

export default Account;
